import { Swiper, SwiperSlide } from "swiper/react";

import { Link } from "react-router-dom";

import background from "../assets/bgr1.jpg";
import btn from "../assets/btn1.png";

import '../Cdn/App.scss';

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import {
  EmailShareButton,
  FacebookShareButton,
  HatenaShareButton,
  InstapaperShareButton,
  LineShareButton,
  LinkedinShareButton,
  LivejournalShareButton,
  MailruShareButton,
  OKShareButton,
  PinterestShareButton,
  PocketShareButton,
  RedditShareButton,
  TelegramShareButton,
  TumblrShareButton,
  TwitterShareButton,
  ViberShareButton,
  VKShareButton,
  WhatsappShareButton,
  WorkplaceShareButton,
  FacebookIcon,
  TwitterIcon,

} from "react-share";


import "./styles.css";

// import required modules
import { Autoplay, Pagination, Navigation } from "swiper";
import { Hidden } from "@mui/material";
import ReactLogo from '/Users/san/Downloads/my-app/src/what.svg';
import { height } from "@mui/system";
export default function App() {
  return (


    <>
    <div className="App z-" >
      <img src={ReactLogo} alt="React Logo" />
    </div>
      <Swiper style={{
        height: "50vh",
        marginTop: "50px",
        marginBottom: "50px",
      }}
        spaceBetween={30}
        centeredSlides={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: false,
        }}
        navigation={false}
        modules={[Autoplay, Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>Slide 1</SwiperSlide>
        <SwiperSlide>Slide 2</SwiperSlide>
        <SwiperSlide>Slide 3</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 5</SwiperSlide>
        <SwiperSlide>Slide 6</SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
      </Swiper>


<div style={{ 
  backgroundImage: `url(${background})`,
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  backgroundRepeat: 'no-repeat',
  height: '90vh',
  width: '100%',
  position: 'relative',
  top: '0',
  left: '0',
  zIndex: '1',
  opacity: '1.5',
}}>


<Link to='/menu' style={{
backgroundImage: `url(${btn})`,
backgroundRepeat: 'no-repeat',
backgroundPosition: 'center',
height: '105px',
width: '250px',
position: 'absolute',
top: '50%',
left: '50%',
transform: 'translate(-50%, 10%)',
zIndex: '2',
opacity: '1.5',
backgroundSize: 'cover',

}} >
</Link>

<h1 style={{
  color: 'black',
  fontSize: '50px',
  position: 'absolute',
  top: '46%',
  left: '41.5%',

}}> <b>Our Food</b></h1>
      </div>
{/* social media plugins */}
<div style={{
  position: 'fixed',
  top: '90%',
  left: '5%',
  transform: 'translate(-50%, -50%)',
  color: 'black',
  fontSize: '50px',
  zIndex: '2',
  opacity: '1.5',
}}>
<div className="box">
{/* facebook share */}
<FacebookShareButton
  url={"https://www.facebook.com/React-Bootstrap-109811025727740"}
  quote={"React-Bootstrap"}
  hashtag="#reactbootstrap"
>
  <FacebookIcon size={32} round />
</FacebookShareButton>
{/* twitter share */}
<TwitterShareButton
  url={"https://www.facebook.com/React-Bootstrap-109811025727740"}
  quote={"React-Bootstrap"}
  hashtag="#reactbootstrap"
>
  <TwitterIcon size={32} round />
</TwitterShareButton>

</div>

</div>

    </>
  );
}
